INSERT INTO `article` VALUES (1,141,NULL,'Frequently Asked Questions','Sub title','Questions','Author ','<p>有问题请加我们微信，客服小妹全天为你解答问题哦！</p>\r\n\r\n<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-01-14/albany%E5%BA%97%E4%BA%8C%E7%BB%B4%E7%A0%81.png\" style=\"width: 200px; height: 232px;\" /></p>\r\n','keywords',NULL,1,0,NULL,NULL,0,'2017-12-04 16:15:59','2019-02-14 02:58:40','',''),(2,143,NULL,'Terms & Conditions','Terms & Conditions','Terms','','<p>下图为您详细讲解了网站的下单流程：</p>\r\n\r\n<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-11-12/%E4%B8%8B%E5%8D%95%E6%B5%81%E7%A8%8B.jpg\" style=\"height: 2551px; width: 1000px;\" /></p>\r\n','',NULL,1,0,NULL,NULL,0,'2017-12-13 12:15:24','2018-11-12 20:43:20','',''),(3,144,NULL,'Shipping Policy','','Shipping','','<p><span style=\"font-size:18px;\">新西兰直邮运费说明</span></p>\r\n\r\n<p>全场满1KG包邮，不足1公斤加收10-20元运费。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px;\">国内现货运费说明</span></p>\r\n\r\n<p>非偏远地区1公斤以内10元运费。&nbsp; 偏远地区按具体位置加收运费（具体以快递公司收费为准）。</p>\r\n','',NULL,1,0,NULL,NULL,0,'2017-12-13 12:15:45','2019-02-14 03:31:16','',''),(4,145,NULL,'About Us','','About Us','','<p>欢迎来到Yomi海淘跨境购致力于新西兰本土奶粉,保健品,化妆品等备受大众喜爱的产品，出口产品主要源自于新西兰本土厂家,经过新西兰政府认证授权,让您买的放心。</p>\r\n\r\n<p>为了便利国内外客人,本公司承接保健品,奶粉等出口业务，给您提供门对门的邮递服务,全部由新西兰空运直邮到您的指定地址。</p>\r\n\r\n<p>我们的团队成员熟知业务和产品,可以帮助您有效快捷的购买和认识新西兰的纯天然产品。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"color:#c0392b;\"><span style=\"font-size:18px;\">欢迎扫码咨询我们</span></span></strong></p>\r\n\r\n<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-01-14/albany%E5%BA%97%E4%BA%8C%E7%BB%B4%E7%A0%81.png\" style=\"width: 200px; height: 232px;\" /></p>\r\n','',NULL,1,0,NULL,NULL,0,'2017-12-13 12:16:10','2019-04-15 17:58:53','',''),(5,155,NULL,'联系我们','','Contact Us','author','<h2>国内实体店位置：湖南省湘潭市岳塘区建设路口湘潭中心</h2>\r\n\r\n<h2>新西兰店铺位置：unit1，18 Corinthian Drive, Albany，Auckland，New Zealand</h2>\r\n\r\n<h2><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-04-18/01