  `file_path` varchar(1024) NOT NULL,
  `position` int(11) DEFAULT '0',
  `description` text,
  `create_time` datetime DEFAULT NULL,
  `href` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `menu_id` (`menu_id`),
