插头啊！</span></p>\r\n\r\n<p><span style=\"font-size:18px;\">3.&nbsp;牙刷是100%德国原装进口，采购于澳洲超市。刷头德国制造，刷柄和插座中国制造，小伙伴们请知悉！</span></p>\r\n','','','2018-09-18 11:05:44','2019-05-17 02:55:42','NZ','',0,NULL,'',''),(19,195,'670983097900',NULL,'Jellycat 龇牙系列 粉色河马 大号 H36cm','Jellycat Toothy Hippo H36cm',NULL,'attachment/img/2019-03-27/TO3HI.jpg',0,35.99,0,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,0.00,0.00,NULL,0.00,NULL,460,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/2a229e25fb2fa733.jpg\" style=\"width: 790px; height: 2521px;\" /></p>\r\n','','','2018-09-18 11:05:44','2019-08-06 09:54:54','NZ','儿童节特惠',0,NULL,'',''),(20,234,'9311770598170',NULL,'Swisse 钙片+维生素D 成人孕妇老人补钙 150粒 2022.01','Swisse Calcium and Vitamin D 150c',NULL,'attachment/img/2018-12-18/swisse大钙.jpg',13,16.7,0,0,0,1,NULL,1,NULL,NULL,69,NULL,0,1,9955.00,0.00,NULL,0.35,NULL,569,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(1).jpg\" style=\"width: 790px; height: 871px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(2).jpg\" style=\"width: 790px; height: 1159px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(3).jpg\" style=\"width: 790px; height: 1070px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(4).jpg\" style=\"width: 790px; height: 1383px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(5).jpg\" style=\"width: 790px; height: 1448px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(6).jpg\" style=\"width: 790px; height: 1177px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(7).jpg\" style=\"width: 790px; height: 880px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(8).jpg\" style=\"width: 790px; height: 630px;\" /></p>\r\n','','','2018-09-18 1