ign=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font color=\"#000000\"><span style=\"color:#993399\"><strong><font face=\"幼圆\"><font size=\"5\"><span style=\"font-family:宋体\">EPA:42mg</span></font></font></strong></span></font></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font color=\"#000000\"><span style=\"color:#993399\"><font face=\"幼圆\"><span style=\"font-family:宋体\"><strong>DHA:300mg</strong></span></font></span></font></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font color=\"#000000\"><span style=\"color:#993399\"><font face=\"幼圆\"><font size=\"4\">DPA 8.4毫克</font></font></span></font></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font color=\"#000000\"><span style=\"color:#993399\"><strong><strong><font face=\"幼圆\"><font size=\"5\">OMEGA-6:150mg</font></font></strong></strong></span></font></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font color=\"#000000\"><span style=\"color:#993399\"><strong><font face=\"幼圆\"><font size=\"5\">GLA:15mg</font></font></strong></span></font></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font color=\"#000000\"><span style=\"color:#993399\"><font face=\"幼圆\"><font size=\"4\">AA 8.4毫克</font></font></span></font></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font color=\"#000000\"><span style=\"color:#993399\"><strong><font face=\"幼圆\"><font size=\"5\">天然维生素E:2.8mg</font></font></strong></span></font></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\">&nbsp;</p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><strong><font color=\"#ff3366\"><font size=\"4\">这款高端鱼油含DHA300毫克，国际孕期营养专家推荐的计量，很多市面的孕妇鱼油DHA含量往往只有200毫克，没有达到孕期所需的量。</font></font></strong></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:0cm 0cm 0pt; padding:0px\">&nbsp;</p>\r\n\r\n<div style=\"margin:0px; padding:0px\">\r\n<div style=\"margin:0px; padding:0px\">&nbsp;</div>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"color:#3d85c6\"><strong><span style=\"font-size:18px\"><span style=\"font-family:宋体\">Equazen研制出Mumomega是特别给妊娠及授乳期妇女，尤其在怀孕期间更需要这些特殊的脂肪酸如DHA及AA,用作组织眼睛及脑部细胞生长, 所以准妈妈必须从日常膳食或从补充剂中摄取恰当的脂肪酸来维持妊娠期所需。而Mumomega就是一个营养补充剂给予她们所需，它含优质DHA、AA、EPA、GLA、DPA。 根据专家意见孕妇和授乳期的母亲，为身体达到最足够的脂肪酸，每日至少要摄取300mg的DHA，来帮助胎儿、幼儿脑部迅成长。</span></span></strong></span></span></span></span></p>\r\n</div>\r\n\r\n<div style=\"margin:0px; padding:0px\">\r\n<div style=\"margin:0px; padding:0px\">\r\n<div style=\"margin:0px; padding:0px\">&nbsp;</div>\r\n\r\n<div style=\"margin:0px; padding:0px\">\r\n<p style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><span style=\"font-size:24px\"><span style=\"color:#ff9900\"><strong><span style=\"color:#ff0000\"><span style=\"border-collapse:separate\"><span style=\"line-height:21px\"><strong><font face=\"Verdana\">【如何判别优质鱼油】</font></strong></span></span></span></strong></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><span style=\"font-size:24px\"><span style=\"color:#ff9900\"><strong><span style=\"border-collapse:separate; color:#000000\"><span style=\"font-size:14px\"><span style=\"line-height:21px\"><span style=\"color:#ff9900\"><strong><font face=\"Verdana\"><font size=\"4\">一，看DHA与EPA的含量：<span style=\"color:#3d85c6\">一般天然鱼油产品，每1000毫克含DHA120mg，EPA180毫克。DHA用来帮助大脑、眼镜、皮肤发育，EPA用来帮助稀释血液、降低血脂，因此补脑类的鱼油DHA含量较高，而降压降脂的鱼油EPA较高。一般的鱼油DHA与EPA的比例在2:3左右。DHA与EPA的含量高低直接关系到鱼油的价格与功效，含量越高，价格越高，效果越好。对于孕妇来说，高浓度DHA是必须的，而EPA则越低越好，否则孕妇会出现头晕等症状，<span style=\"color:#ff0000\">MumOmega的高科技之处便在于保留高纯DHA的同时却大大降低了EPA的含量</span>。</span></font></font></strong></span></span></span></span></strong></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><span style=\"font-size:24px\"><span style=\"color:#ff9900\"><strong><span style=\"border-collapse:separate; color:#000000\"><span style=\"font-size:14px\"><span style=\"line-height:21px\"><span style=\"color:#ff9900\"><strong><font face=\"Verdana\"><font size=\"4\">二，看颜色：<span style=\"color:#3d85c6\">优质的鱼油，胶囊清澈透明，刺破胶囊后内部的鱼油应该是金黄色或浅黄色，而不是深黄色或颜色浑浊不清。</span></font></font></strong></span></span></span></span></strong></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><span style=\"font-size:24px\"><span style=\"color:#ff9900\"><strong><span style=\"border-collapse:separate; color:#000000\"><span style=\"font-size:14px\"><span style=\"line-height:21px\"><span style=\"color:#ff9900\"><strong><font face=\"Verdana\"><font size=\"4\">三，看包装：<span style=\"color:#3d85c6\">专业的鱼油产品使用的包装应为不透光、不透明包装，而不是透明塑料瓶包装。因为鱼油被阳光照射后极易氧化，一旦鱼油发生氧化，您再服用之后不但对身体没有任何好处，还会增加肾脏对鱼油氧化后产生的不良油脂的排泄压力。</span></font></font></strong></span></span></span></span></strong></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><span style=\"font-size:24px\"><span style=\"color:#ff9900\"><strong><span style=\"border-collapse:separate; color:#000000\"><span style=\"font-size:14px\"><span style=\"line-height:21px\"><span style=\"color:#ff9900\"><strong><font face=\"Verdana\"><font size=\"4\">四，尝味道：<span style=\"color:#3d85c6\">鉴定鱼油质量好坏，咬开尝一尝就能知道。质量好的鱼油尝起来或闻着没有太大味道，味道非常中性自然。如果鱼油的味道很浓很腥，就证明鱼油的质量很低。尤其是某些高端的鱼油，比如MumOmega、纯三文鱼鱼油（如<a href=\"http://item.taobao.com/item.htm?id=4133882334\" style=\"text-decoration:none; color:#3366cc; outline:0px; margin:0px; padding:0px\" target=\"_blank\">Thompson&#39;s深海三文鱼油</a>）、或鳕鱼鱼油（<a href=\"http://item.taobao.com/item.htm?id=12844395621&amp;spm=1100057096976.0000000117518050.000000284570245114.8\" style=\"text-decoration:none; color:#3366cc; outline:0px; margin:0px; padding:0px\" target=\"_blank\">Nordic婴儿鱼油</a>），这类高纯度鱼油更是没有浓重的腥味。越是采集于小杂鱼、甚至使用杂鱼内脏等废弃物制造的鱼油，腥味越大。</span></font></font></strong></span></span></span></span></strong></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><span style=\"font-size:24px\"><span style=\"color:#ff9900\"><strong><span style=\"border-collapse:separate; color:#000000\"><span style=\"font-size:14px\"><span style=\"line-height:21px\"><span style=\"color:#ff9900\"><font face=\"Verdana\"><font size=\"4\"><b><strong><font face=\"Verdana\"><font size=\"4\">五，看配比：<span style=\"color:#3d85c6\">不同的消费者应注意选择不同含量配比的鱼油产品。DHA含量与EPA含量比例为2.5(DHA)比1(EPA)以上的，适用于3岁以上的儿童、青少年学生改善记忆、帮助眼睛发育。对于3岁以下婴幼儿服用的鱼油，DHA于EPA的含量比则应在1:1.5最利于宝宝吸收。大部分的普通鱼油DHA和EPA含量均等或EPA含量高于DHA，适用于中老年人降血脂，青少年不宜食用（因为EPA的主要功效是稀释血液粘稠度、帮助降血脂）。</span></font></font></strong></b></font></font></span></span></span></span></strong></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><span style=\"font-size:24px\"><span style=\"color:#ff9900\"><strong><span style=\"border-collapse:separate; color:#000000\"><span style=\"font-size:14px\"><span style=\"line-height:21px\"><span style=\"color:#ff9900\"><font face=\"Verdana\"><font size=\"4\"><b><strong><font face=\"Verdana\"><font size=\"4\">六，</font></font></strong></b></font></font></span><strong><span style=\"color:#3d85c6\"><span style=\"font-size:18px\"><span style=\"font-family:verdana\"><span style=\"color:#ff9900\">简单的鉴别方法:</span>将高品质鱼油和普通鱼油同时放人冰箱内，普通鱼油在０℃以下时将凝固或结冰，而高品质鱼油仍具有良好的流动性。当然，鱼油产品一般都在常温下保存，低温冷藏并不适宜，此法只适于鉴别时使用哦！</span></span></span></strong></span></span></span></strong></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><span style=\"font-size:24px\"><span style=\"color:#ff9900\"><strong><span style=\"border-collapse:separate; color:#000000\"><span style=\"font-size:14px\"><span style=\"line-height:21px\">----------------摘自天涯网及中国保健品门户网（www.zgbjpmh.com）</span></span></span></strong></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p style=\"margin:0cm 0cm 0pt; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font size=\"4\"><strong><font color=\"#330000\">根据专家意见孕妇和哺乳期的母亲</font><font face=\"宋体\">,</font>为身体达到最足够的脂肪酸<font face=\"宋体\">,</font>每日至少要摄取<font face=\"?翁?\">300mg</font>的<font face=\"宋体\">DHA,</font>他们同时建议初生婴儿每日至少摄取<font face=\"宋体\">100mg</font>的<font face=\"宋体\">DHA,</font>因此<font face=\"宋体\">Eye q baby</font>因而诞生。</strong></font></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font color=\"#cc6666\"><font face=\"宋体\"><font size=\"4\"><strong data-spm-anchor-id=\"2013.1.0.i4.413c7c19d4wTp1\">鱼油中DHA是胎儿脑发育所必需的物质，它主要是对脑神经生长发育有很重要的作用，因为人体脑细胞的分化与发育有70&mdash;80％是在出生前3个月内完成的，其余部分在出生后数日内完成，因此孕妇在此阶段服用足够的DHA才能保障胎儿神经系统的顺利发育。</strong></font></font></font></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:1.12em 0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"background-color:#ffffff\"><span style=\"font-family:宋体\"><font color=\"#cc6666\"><font face=\"宋体\"><font size=\"4\"><strong>每粒胶囊含有:</strong></font></font></font></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<ul style=\"margin:1em 1em 1em 0px; padding:0px 0px 0px 40px; list-style:none; color:#000000; font-family:tahoma, arial, 宋体, sans-serif; font-size:14px; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:normal; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; background-color:#ffffff\">\r\n	<li style=\"margin:0px; padding:0px; list-style:disc\"><span style=\"font-family:宋体\"><font color=\"#cc6666\"><font face=\"宋体\"><font size=\"4\"><strong>DHA 300 mg</strong></font></font></font></span></li>\r\n	<li style=\"margin:0px; padding:0px; list-style:disc\"><span style=\"font-family:宋体\"><font color=\"#cc6666\"><font face=\"宋体\"><font size=\"4\"><strong>EPA 42 mg</strong></font></font></font></span></li>\r\n	<li style=\"margin:0px; padding:0px; list-style:disc\"><span style=\"font-family:宋体\"><font color=\"#cc6666\"><font face=\"宋体\"><font size=\"4\"><strong>GLA 15 mg</strong></font></font></font></span></li>\r\n	<li style=\"margin:0px; padding:0px; list-style:disc\"><span style=\"font-family:宋体\"><font color=\"#cc6666\"><font face=\"宋体\"><font size=\"4\"><strong>Vit E 2.8 mg (28% RDA)</strong></font></font></font></span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n','','','2018-09-18 11:05:56','2019-04-29 00:12:05','NZ','',0,NULL,'',''),(161,200,'9419521885583',NULL,'Nature\'s Beauty 自然美 火山泥面膜200g','Nature‘s Beauty Mineral Radiance Mask 200g',NULL,'attachment/img/2018-10-22/Nature Beauty火山泥面膜200g_主图5.jpg',6,7.99,0,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,2.00,0.00,NULL,0.25,NULL,480,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-22/Nature%20Beauty%E8%87%AA%E7%84%B6%E7%BE%8E%E7%81%AB%E5%B1%B1%E6%B3%A5%E9%9D%A2%E8%86%9C.jpg\" style=\"width: 774px; height: 4536px;\" /></p>\r\n','','','2018-09-18 11:05:56','2019-04-29 00:11:29','NZ','',0,NULL,'',''),(162,200,'9421902515026',NULL,'Savar 奢华洗面奶180ml','Savar facial cleanser 180ml',NULL,'attachment/img/2019-03-09/Savar 奢华洗面奶 180毫升.jpg',28,33.2,0,0,0,1,NULL,NULL,NULL,1,NULL,NULL,0,1,1.00,0.00,NULL,0.34,NULL,491,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/savar%E6%B4%97%E9%9D%A2%E5%A5%B6.jpg\" style=\"width: 774px; height: 6349px;\" /></p>\r\n','','','2018-09-18 11:05:57','2019-10-18 15:45:44','NZ','',0,NULL,'',''),(163,234,'93807937',NULL,'BLACKMORES 澳佳宝 天然活性维生素C 1000mg 150片','Blackmore Bio C 1000mg 150t',NULL,'attachment/img/2018-10-21/Blackmores天然活性维生素C 1000毫克 150片.jpg',28.6,31.5,0,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,4.00,0.00,NULL,0.52,NULL,457,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/blackmores%E7%BB%B4C.jpg\" style=\"width: 814px; height: 2575px;\" /></p>\r\n','','','2018-09-18 11:05:57','2019-04-29 00:10:39','NZ','',0,NULL,'',''),(164,176,'9331134927828',NULL,'PAMOL 感冒发烧药 1-12岁草莓味 100ml','PAMOL relieves children‘s pain&fever 1-12years strawberry 100ml',NULL,'attachment/img/2018-10-14/微信图片_201810141634263.jpg',8.8,10.99,0,0,0,1,NULL,NULL,NULL,NULL,44,NULL,0,1,100.00,0.00,NULL,0.25,NULL,436,'','<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">新澳医生推荐Pamol宝宝发烧退烧止疼液(1岁以上适合，包括成人</font></font></font><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">) 100ml<br />\r\n强烈推荐！</font></font></font><span style=\"font-size:36px\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">新西兰每个有孩子的家庭都有备，没有布洛芬,没有抗生素，没有激素，没有依赖性，非常安全有效。</font></font></font></span><br />\r\n<br />\r\n<font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">本产品不同于国内的退烧药美林，因为美林所含的布洛芬是新西兰和澳洲禁用的成分,而Pamol是新澳医生推荐本地宝宝的退烧药。</font></font></font><br />\r\n<br />\r\n<font size=\"3\"><font color=\"#000000\"><font face=\"微软雅黑\">布洛芬对于儿科而言是不安全的，它会引起肾脏损害，特别是由于腹泻引起的发烧，如果处在脱水状态引起的肾脏损害还更加严重，甚至是不可逆的，往往家长本身是不能正确判定宝宝是否处于脱水状态，因此该药物在澳大利亚和新西兰严禁给婴幼儿使用！在中国目前没有相关法律，但请中国的爸妈们注意，不要给宝宝服用含有布洛芬的药物！）</font></font></font><br />\r\n<br />\r\n<font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">Pamol</font></font></font><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">发烧止痛无色素口服液迅速退烧、舒缓牙疼，耳痛，接种预防针之后，头疼及感冒或发烧引起的各种疼痛。药性温和，适合宝宝幼嫩的肠胃。无人工添加素，每次只需少量，保护小宝宝的娇小幼嫩的胃。口味是宝宝喜欢的草莓和橙子味道，没有添加任何糖份，妈妈喂得省心宝宝吃的放心。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">【用法用量】</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">请参照宝宝的体重或月龄适量喂食</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">1岁-5岁：2.5-5.0ml</font></font></font></span></span></span></span></span></s