p><strong>&middot; 像水一样温和，低过敏性</strong></p>\r\n\r\n<p><strong>&middot; 贴心保护长达4小时</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>使用方法：</strong></p>\r\n\r\n<p><strong>均匀地涂在肌肤上，涂后15分钟才暴露在太阳下，游泳、抹身或隔一段时间应重覆涂抹以达至最佳防晒效果。</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>【产品功效】<br />\r\n1、 能广泛抵挡UVAI、UVAII、UVB紫外线<br />\r\n2、 可在化妆前使用<br />\r\n3、 能减少对皮肤的刺激性<br />\r\n4、 不油腻、不会阻塞毛孔，无色，无油，无香料，防水<br />\r\n5、 不含PABA<br />\r\n纯物理防晒剂，不含PABA（对氨基苯甲酸），香料，不会被皮肤吸收，在皮肤表面可形成一层保护屏障，不会过敏，适合于敏感皮肤的人使用；不含油分，所以使 用舒适，毫无油腻感；防晒范围广泛：可有效阻挡290nm－380nm范围内的UVB和UVA，既可以防止晒伤，又可以防止晒黑！全面有效的阻挡紫外线对 皮肤造成的损伤，防止皮肤光老化。</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>注意事项：</strong></p>\r\n\r\n<p><strong>1.务必在接触阳光前15分钟抹上。<br />\r\n2.虽然是防水的，但是在游泳或用湿毛巾试擦后，还是建议再重新涂上一层。<br />\r\n3.使用时，请先用力摇均匀。打开盖子对准目标区域，保持20-30厘米的距离，然后按压喷头按钮，一次性按到底，均匀地喷涂在身体上</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Very High Protection Clear Sunscreen Spray SPF50+ that allows sand to easily brush off and moisturises to relieve dryness that can be caused by the sun. Perfect for the beach!</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<dl>\r\n	<dt id=\"descAttributeName_3_11_-2018_3074457345618261092\"><strong>Warnings</strong></dt>\r\n	<dd id=\"descAttributeValue_3_11_-2018_3074457345618261092\"><strong>Caution: Extremely flammable. Pressurized dispenser. Do not pierce or burn, even after use. Do not spray on a naked flame or any incandescent material. Keep away from sources of ignition - no smoking. Use only as directed. Intentional misuse by deliberately concentrating and inhaling contents can be harmful or fatal. Keep out of reach of children. Always read the label. Use only as directed.</strong></dd>\r\n</dl>\r\n\r\n<dl>\r\n	<dt id=\"descAttributeName_4_11_-2018_3074457345618261092\"><strong>Instructions</strong></dt>\r\n	<dd id=\"descAttributeValue_4_11_-2018_3074457345618261092\"><strong>Shake well before use. Use in well ventilated area. Avoid inhalation. Do not apply in windy conditions. Do not apply to broken, damaged or diseased skin. Do not spray directly on face. Spray on hands to apply to face. Avoid contact with eyes.</strong></dd>\r\n</dl>\r\n\r\n<dl>\r\n	<dt id=\"descAttributeName_5_11_-2018_3074457345618261092\"><strong>Storage &amp; Disposal</strong></dt>\r\n	<dd id=\"descAttributeValue_5_11_-2018_3074457345618261092\"><strong>Store below 30 Degrees Celsius.</strong></dd>\r\n</dl>\r\n\r\n<dl>\r\n</dl>\r\n','','','2018-09-18 11:05:58','2019-05-30 00:27:25','NZ','夏日推荐',0,NULL,'',''),(182,200,'9316542120504',NULL,'Natio Ageless 面膜 100g','Natio Ageless Hydrating Mask 100g',NULL,'attachment/img/2018-10-21/Natio面膜_主图5.jpg',15.2,17.99,0,0,0,1,NULL,NULL,NULL,NULL,1,NULL,0,1,9.00,0.00,NULL,0.14,NULL,448,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/Natio%E9%9D%A2%E8%86%9C.jpg\" style=\"width: 774px; height: 5356px;\" /></p>\r\n','','','2018-09-18 11:05:58','2019-04-29 00:03:34','NZ','',0,NULL,'',''),(183,176,'9400501003448',NULL,'Comvita 康维他 麦卢卡蜂蜜棒棒糖 UMF 10+','Comvita Childrens Lemon and Honey Lollipops',NULL,'attachment/img/2018-10-21/Comvita UMF10+ 棒棒糖_主图3.jpg',8.5,9.99,0,0,0,1,NULL,NULL,NULL,NULL,11,NULL,0,1,7.00,0.00,NULL,0.19,NULL,537,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/Comvita%20UMF10+%20%E6%A3%92%E6%A3%92%E7%B3%96.jpg\" style=\"width: 774px; height: 4402px;\" /></p>\r\n','','','2018-09-18 11:05:58','2019-04-29 00:02:58','NZ','',0,NULL,'',''),(184,193,'9353965005124',NULL,'BBox 升级版宝宝重力吸管杯学饮杯六个月以上 荧光绿色','B Box sippy cup Pineapple - neon edition',NULL,'attachment/img/2019-09-26/bbox 荧光绿.jpg',9,11,0,0,0,1,NULL,NULL,NULL,NULL,12,NULL,0,1,10.00,0.00,NULL,0.19,NULL,471,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/b.box%E6%B0%B4%E6%9D%AF01.jpg\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/b.box%E6%B0%B4%E6%9D%AF02.jpg\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/b.box%E6%B0%B4%E6%9D%AF03.jpg\" /><img 