width: 790px; height: 1034px;\" /></p>\r\n','','','2018-09-18 11:06:01','2019-10-30 16:46:22','NZ','',17,NULL,'',''),(213,249,'9420015002089',NULL,'ecostore 葡萄柚&薄荷皂 80g','ECO STORE Boxed Grapefruit & Mint Soap',NULL,'attachment/img/2019-04-10/ecostore grapefruit.png',1.8,2.49,0,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,24.00,0.00,NULL,0.10,NULL,452,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/ECO%E9%A6%99%E7%9A%82.jpg\" style=\"width: 700px; height: 7478px;\" /></p>\r\n','','','2018-09-18 11:06:01','2019-04-28 23:47:01','NZ','',7,NULL,'',''),(214,246,'9421028121910',NULL,'Beauteous 牛初乳绵羊油 100g','Beauteous colostrum cream beauteous 100g',NULL,'attachment/img/2018-10-21/Beauteous胶原蛋白绵羊油100g.jpg',3.5,4.8,0,0,0,1,NULL,NULL,NULL,NULL,19,NULL,0,1,999999.00,0.00,NULL,0.18,NULL,464,'','<p>&nbsp;Beauteous胶原蛋白面霜&nbsp;100克：这款Beauteous绵羊油系列分4款不同产品：黄色盖子是绵羊油保湿面霜，蓝色盖子是胶原蛋白绵羊油抗衰老面霜，绿色盖子是羊胎素芦荟VE绵羊油抗皱淡斑面霜，白色盖子的则是牛初乳抗氧化亮白面霜。大家可以根据自己的需要进行选择，每一瓶都有精美独立的纸盒包装，每瓶100g，送人自用都合适！&nbsp;本品采用新西兰纯天然羊毛脂，羊胎盘素和胶原蛋白等精华，特别加入脂质体，经过微乳化程序配炼而成。除具有普通羊胎素之功效外，还能深入皮肤深层，通过脂质体的运载，不断释放出养分至皮肤表层，从而滋润皮长达24小时之久，另皮肤时刻保持柔软，娇嫩，富有弹性。其独特处方设计,既能保护皮肤减低受外界影响，又能从体内不断供给皮肤足够养分</p>\r\n','','','2018-09-18 11:06:01','2019-05-02 13:31:51','NZ','',0,NULL,'',''),(215,246,'9421028121811',NULL,'Beauteous 胶原蛋白绵羊油 100g','Beauteous Collagen Cream Beauteous 100g',NULL,'attachment/img/2019-01-16/Beauteous胶原蛋白绵羊油100g02.jpg',3.5,4.8,0,0,0,1,NULL,NULL,NULL,NULL,34,NULL,0,1,86.00,0.00,NULL,0.18,NULL,586,'','','','','2018-09-18 11:06:01','2019-09-24 17:42:07','NZ','',0,NULL,'',''),(216,200,'3614272844766',NULL,'兰蔻小黑瓶精华圣诞套装','',NULL,'attachment/img/2019-04-15/essano hand cream.jpg',158,177,0,0,0,1,NULL,NULL,NULL,1,2,NULL,0,1,4.00,0.00,NULL,0.15,NULL,485,'','<p>Rosehip Hand Cr&egrave;me 120ml</p>\r\n\r\n<p>【产品特点】</p>\r\n\r\n<p>保湿滋润、滋养手部皮肤</p>\r\n\r\n<p>【产品介绍】</p>\r\n\r\n<p>该产品来自新西兰，100%有机原料。产品中绝对不含对人体有害的任何成份。保湿滋润，长期使用定会发现手部肌肤的变化。如水般得滋润，淡淡的清香特别喜欢。</p>\r\n\r\n<p>【主要成分】</p>\r\n\r\n<p>库拉索芦荟叶汁、乳木果油、羊毛脂、葵花籽油、白蜂蜡、荷荷巴油脂、玫瑰果油</p>\r\n\r\n<p>羊毛脂：它具有较好的乳化、润湿和渗透作用。具有柔软皮肤、防止脱脂和防止皮肤皲裂的功能。</p>\r\n\r\n<p>葵花籽油：富含维生素E，滋润抗氧化。</p>\r\n\r\n<p>白蜂蜡：滋润美白皮肤。</p>\r\n\r\n<p>荷荷巴油：具有补水和锁水功能！为肌肤带来水分的同时提升自身储水功能，让肌肤远离干燥与粗糙！</p>\r\n\r\n<p>玫瑰果油：日用功效：深层滋润肌肤、提供养份，使肌肤柔软、嫩滑、湿润，防止紫外线对皮肤造成伤害，美白肌肤；增加皮肤组织活力，保持皮肤富有弹性，收缩粗糙毛孔，可使干裂皮肤恢复其自然光彩：改善和消除-创伤后新旧-疤痕</p>\r\n\r\n<p>【创新科研配方】</p>\r\n\r\n<p>对抗干燥、抚平粗糙</p>\r\n\r\n<p>深层滋养、柔软肤质</p>\r\n\r\n<p>对抗手部皮肤水分流失</p>\r\n\r\n<p>【使用方法】</p>\r\n\r\n<p>1. 随时随地，清洁手部后，取适量均匀涂抹</p>\r\n\r\n<p data-spm-anchor-id=\"2013.1.0.i1.97bff4bKRCM4A\">2. 临睡前，涂抹手霜有助次日获得柔软、娇嫩的护手体验</p>\r\n','','','2018-09-18 11:06:01','2019-11-13 15:42:19','NZ','',0,NULL,'',''),(217,256,'9400533006257',NULL,'Repel 薰衣草成人驱蚊滚珠 60ml','repel insect repellent 60ml',NULL,'attachment/img/2018-10-21/Repel薰衣草成人驱蚊滚珠60ml.jpg',8,10.5,0,0,0,1,NULL,NULL,NULL,NULL,2,NULL,0,1,2.00,0.00,NULL,0.10,NULL,451,'','<p>天然安全新西兰药房推荐夏季驱蚊产品</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【英文名称】Repel &quot;Junior&quot; Insect Repellent Roll On with Antiseptics&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Repel婴幼儿驱蚊乳液走珠装/滚珠露 薰衣草味</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【产品规格】60毫升</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;【产 地】新西兰</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;【适用范围】不仅防蚊，也适用于防止白蛉等昆虫的叮咬。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【适用年龄】6个月以上</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【使用方法】外用，涂抹于暴露在外的皮肤上。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【储存方式】储存时，向上放置于30摄氏度以下。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【有效时间】2-4小时</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>夏季，爸爸妈妈们有更多机会带宝宝外出游玩，天气炎热，蚊虫很多，为了宝宝肌肤健康，请备好婴幼儿驱蚊乳液。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;【产品介绍】&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>本产品在安全、无毒、对宝宝肌肤保湿的情况下，达到真正的有效避蚊。降低了驱蚊胺的含量和走珠易用包装，满足对低药剂含量客户的需求。正常情况下，6个月以上的婴幼儿可安全使用(如有疑虑，请先向医生咨询)，成人也适用。</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Apex Repel婴幼儿驱蚊乳液，将乳化剂封闭在硅树脂里，延长产品在皮肤上的有效时间，进而延长了再次使用的间隔时间。含抗菌剂以延长产品作用的有效性。走珠装，使用简单, &nbsp;即使在热带地区和旅行途中也安全有效。</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>防水，不含酒精，有股药味，携带、使用都很方便哦。</p>\r\n','','','2018-09-18 11:06:01','2019-04-28 23:45:44','NZ','',0,NULL,'',''),(218,229,'9421027311077',NULL,'Earthwise 河马宝宝儿童沐浴乳（蓝色） 添加羊奶 275ml','Earthwise baby by earthwise bubble body wash with goats milk 275ml',NULL,'attachment/img/2018-10-21/Earthwise婴儿有机羊奶沐浴露 蓝色小河马装 275ml.jpg',4.3,6.99,0,0,0,1,NULL,NULL,NULL,NULL,5,NULL,0,1,1.00,0.00,NULL,0.40,NULL,491,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/%E5%B0%8F%E6%B2%B3%E9%A9%AC%E5%AE%9D%E5%AE%9D%E6%B2%90%E6%B5%B4%E9%9C%B2%EF%BC%88%E8%93%9D%E8%89%B2%EF%BC%89.jpg\" style=\"width: 814px; height: 6525px;\" /></p>\r\n','','','2018-09-18 11:06:01','2019-04-28 23:45:28','NZ','',0,NULL,'',''),(219,244,'079656652055',NULL,'Banana boat 香蕉船 SPF50+婴儿防晒霜90ml','Banana Boat sunscreean lotion （tear free） 90ml',NULL,'attachment/img/2019-03-24/Banana boat香蕉船SPF50+婴儿防晒霜90ml.jpg',0,13,0,0,0,0,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,13,'','<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong data-spm-anchor-id=\"2013.1.0.i0.763f13beLWNi7f\">香蕉船 baby 宝宝防晒霜</strong></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>规格：</strong>90ml</span></span></span></p>\r\n\r\n<p align=\"center\" data-spm-anchor-id=\"2013.1.0.i1.763f13beLWNi7f\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>包装：</strong>无盒有塑封</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>适合人群：</strong></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">适合各类儿童肌肤，<font color=\"#ff0000\">6个月以上婴儿与成人</font>，尤其敏感肌肤的MM们；<font color=\"#ff0000\">6个月以下宝宝使用前请咨询医生。</font></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>产品描述：</strong></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">纯物理防晒剂，不含PABA（对氨基苯甲酸），香料，不会被皮肤吸收，在皮肤表面可形成一层保护屏障，</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">不会过敏，适合于敏感皮肤的人使用；不含油分，所以使用舒适，毫无油腻感；防晒范围广泛：</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">可有效阻挡290nm－380nm范围内的UVB和UVA全面有效的阻挡紫外线对皮肤造成的损伤，防止皮肤光老化。</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">2013年香蕉船最新推出天然系列防晒霜，以它有效、温和、自然的特性细心呵护宝宝娇嫩柔弱的肌肤。</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">它是用100％天然来源的防晒活性成分，不含任何伤害性的化学防晒剂。经儿科医生测试，这</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">款天然防晒配方的防晒乳，在皮肤上形成保护层，以物理反射原理抵御日光中的UVA和UVB对皮肤的伤害。</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><font color=\"#ff0000\">SPF50防晒指数的无泪无刺激超温和配方，辅以芦荟等舒缓成分，非常适合宝宝使用。</font></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>使用方法：</strong></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">均匀地涂在肌肤上，涂上后15分钟才暴露在太阳下，游泳、抹身或隔一段时间应重覆涂抹以达至最佳防晒效果。</span></span></span></p>\r\n','','','2018-09-18 11:06:01','2019-04-17 16:17:59','NZ','',0,NULL,'',''),(220,229,'9415293244511',NULL,'Parrs 帕氏 婴儿蜂蜜润肤乳新包装 100ml','Parrs Honey Babe Moisture Creme 100ml tube',NULL,'attachment/img/2019-02-13/帕氏 宝宝润肤乳.jpg',8.7,10.56,0,0,0,1,NULL,NULL,NULL,NULL,3,NULL,0,1,3.00,0.00,NULL,0.00,NULL,481,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/%E5%B8%95%E6%B0%8F%E5%A9%B4%E5%84%BF%E8%9C%82%E8%9C%9C%E6%B6%A6%E8%82%A4%E4%B9%B3%2080ml.jpg\" style=\"width: 774px; height: 2291px;\" /></p>\r\n','','','2018-09-18 11:06:01','2019-10-10 12:53:45','NZ','',0,NULL,'',''),(221,253,'9328121046341',NULL,'Binky bites 小黄人饼干160g','Binky bites character cookies 160g',NULL,'attachment/img/2018-10-21/小黄人饼干.jpg',3.8,4.5,0,0,0,0,NULL,NULL,NULL,1,3,NULL,0,1,1000000.00,0.00,NULL,0.00,NULL,17,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/Binky%20bites%E5%B0%8F%E9%BB%84%E4%BA%BA%E9%A5%BC%E5%B9%B2160g01.jpg\" style=\"width: 576px; height: 5332px;\" /><im