LL,'attachment/img/2019-04-01/00246525.jpg',4.7,6.2,0,0,0,1,NULL,NULL,NULL,NULL,4,NULL,0,1,2.00,0.00,NULL,0.05,NULL,497,'','<p>产品特点：</p>\r\n\r\n<p>这款有机的牙刷是100%玉米淀粉制作而成，软Nylon可循环刷毛，是为儿童设计的安全材质的牙刷。 把手上的图案有Bunny兔、河马、考拉、小恐龙4种，都是小朋友们喜欢的图案，让小朋友们都爱上刷牙。该品牌的牙膏也是小朋友都可以食用的安全级别的牙膏。</p>\r\n\r\n<p>使用方法：</p>\r\n\r\n<p>用最小的压力反复刷牙，再配合同品牌的有机牙膏使用效果更佳。</p>\r\n\r\n<p>保存方法：请置于阴凉处。</p>\r\n\r\n<p>适用年龄：全阶段。已经学会或者在家长指导下会刷牙的婴幼儿。</p>\r\n\r\n<p>注意事项：每8周或破损初期更换一次牙刷，生病后需更换牙刷，使用前后请彻底冲洗牙刷，勤消毒并且保持牙刷存放于干燥处，4岁以下儿童需在成人监督下使用，请勿咬或吞咽牙刷。</p>\r\n\r\n<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/JJ%E7%89%99%E5%88%B7_desc1.jpg\" style=\"width: 790px; height: 932px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/JJ%E7%89%99%E5%88%B7_desc2.jpg\" style=\"width: 790px; height: 936px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/JJ%E7%89%99%E5%88%B7_desc3.jpg\" style=\"width: 790px; height: 1128px;\" /></p>\r\n','','','2018-09-18 11:06:08','2019-08-27 15:08:27','NZ','',3,NULL,'',''),(296,NULL,'9415748022541',NULL,'Pams 藜麦 红豆 450g','Pams red quinoa 450g',NULL,'',0,1,0,0,0,0,NULL,NULL,NULL,NULL,0,NULL,0,1,0.00,0.00,NULL,0.50,NULL,0,'','','','','2018-09-18 11:06:08','2019-04-03 16:04:17','NZ','',0,NULL,'',''),(297,195,'670983097559',NULL,'Jellycat 害羞系列 邦尼兔 银色 特大号 H51cm','Jellycat Bashful Silver Bunny H51cm',NULL,'attachment/img/2019-03-12/微信图片_20190312175810.png',76.4,85.99,0,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,2.00,0.00,NULL,0.74,NULL,458,'','<p>&nbsp;</p>\r\n\r\n<p>In Bashful Silver Bunny&rsquo;s warren, everything is silver! Their soft bed, their teapot, even their tea is Earl Grey! But it&rsquo;s such a pretty colour, it&rsquo;s understandable. Their cuddly silver tummy is deliciously soft and their long lop ears are too fluffy not to tickle!</p>\r\n\r\n<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/2a229e25fb2fa733.jpg\" style=\"width: 790px; height: 2521px;\" /></p>\r\n','','','2018-09-18 11:06:08','2019-08-06 