6180px;\" /></p>\r\n','','','2018-09-18 11:06:12','2019-10-23 15:18:55','NZ','',0,NULL,'',''),(347,256,'94533002',NULL,'Repel 儿童防蚊虫滚珠 新包装 50ml','Repel Junior Roll On',NULL,'attachment/img/2018-10-20/Repel驱蚊滚珠.jpg',8,9.5,0,0,0,1,NULL,NULL,NULL,NULL,3,NULL,0,1,5.00,0.00,NULL,0.12,NULL,473,'','<p>天然安全新西兰药房推荐夏季驱蚊产品</p>\r\n\r\n<p>Repel驱虫药符合世界卫生组织（WHO）的认可和北大西洋公约组织的相关法规，在澳大利亚和新西兰也深受欢迎。</p>\r\n\r\n<p>【产品名称】Apex Repel婴幼儿驱蚊乳液走珠装/滚珠露</p>\r\n\r\n<p>【英文名称】Repel &quot;Junior&quot; Insect Repellent Roll On with Antiseptics</p>\r\n\r\n<p>【产品规格】60毫升</p>\r\n\r\n<p>【产&nbsp;地】100%新西兰原装进口</p>\r\n\r\n<p>【适用范围】不仅防蚊，也适用于防止白蛉等昆虫的叮咬。</p>\r\n\r\n<p>【适用年龄】6个月以上</p>\r\n\r\n<p>【使用方法】外用，涂抹于暴露在外的皮肤上。</p>\r\n\r\n<p>【储存方式】储存时，向上放置于30摄氏度以下。</p>\r\n\r\n<p>【有效时间】2-4小时</p>\r\n\r\n<p>夏季，爸爸妈妈们有更多机会带宝宝外出游玩，天气炎热，蚊虫很多，为了宝宝肌肤健康，请备好婴幼儿驱蚊乳液。</p>\r\n','','','2018-09-18 11:06:12','2019-04-28 22:09:21','NZ','',0,NULL,'',''),(348,200,'9421017760076',NULL,'Trilogy 趣乐活 玫瑰保湿日霜 60ml','Trilogy Rose Vital Moisturising Cream 60ml',NULL,'attachment/img/2018-10-20/Trilogy 野玫瑰保湿面霜 60克.jpg',26.5,30,0,0,0,1,NULL,NULL,NULL,NULL,8,NULL,0,1,8.00,0.00,NULL,0.24,NULL,455,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/ed9a876d860ed71b.jpg\" style=\"width: 790px; height: 3770px;\" /></p>\r\n','','','2018-09-18 11:06:12','2020-03-11 13:27:09','NZ','',0,NULL,'',''),(349,229,'9314839004759',NULL,'Ego QV 儿童小章鱼面霜 100g','QV kids moisturising cream 100g',NULL,'attachment/img/2018-10-20/QV 儿童润肤膏（balm）100g.jpg',9.7,12.3,0,0,0,1,NULL,NULL,NULL,NULL,6,NULL,0,1,5.00,0.00,NULL,0.15,NULL,469,'','<p><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-04-01/20190401_142016_000.jpg\" style=\"width: 790px; height: 1072px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-04-01/20190401_142016_001.jpg\" style=\"width: 790px; height: 827px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-04-01/20190401_142016_002.jpg\" style=\"width: 790px; height: 963px;\" /><img alt=\"