同于国内的退烧药美林，因为美林所含的布洛芬是新西兰和澳洲禁用的成分,而Pamol是新澳医生推荐本地宝宝的退烧药。</font></font></font><br />\r\n<br />\r\n<font size=\"3\"><font color=\"#000000\"><font face=\"微软雅黑\">布洛芬对于儿科而言是不安全的，它会引起肾脏损害，特别是由于腹泻引起的发烧，如果处在脱水状态引起的肾脏损害还更加严重，甚至是不可逆的，往往家长本身是不能正确判定宝宝是否处于脱水状态，因此该药物在澳大利亚和新西兰严禁给婴幼儿使用！在中国目前没有相关法律，但请中国的爸妈们注意，不要给宝宝服用含有布洛芬的药物！）</font></font></font><br />\r\n<br />\r\n<font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">Pamol</font></font></font><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">发烧止痛无色素口服液迅速退烧、舒缓牙疼，耳痛，接种预防针之后，头疼及感冒或发烧引起的各种疼痛。药性温和，适合宝宝幼嫩的肠胃。无人工添加素，每次只需少量，保护小宝宝的娇小幼嫩的胃。口味是宝宝喜欢的草莓和橙子味道，没有添加任何糖份，妈妈喂得省心宝宝吃的放心。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">【用法用量】</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">请参照宝宝的体重或月龄适量喂食</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">1-3个月：4-6kg 1.2-1.8ml</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">3-6个月：6-8kg 1.8-2.4ml</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">6-12个月：8-10kg 2.4-3.0ml</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">-使用前，请摇匀溶液，用滴管量取需要份量。直接喂食或与果汁或水混合后喂食。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351