儿童、成人、中老年人\r\n\r\n【成人建议剂量】：\r\n\r\n普通保健大脑健康精神系统健康：每日1粒，餐时服用\r\n\r\n心血管健康：每日二粒，餐时服用\r\n\r\n眼睛健康：每日三粒，随餐\r\n\r\n情绪平衡：每次三粒，每日二次，随餐\r\n\r\n血脂健康：每日7粒，随餐\r\n\r\n血压健康关节保健：每次5粒，每日2次，餐时服用\r\n\r\n孕妇：每天二粒，随餐\r\n\r\n【儿童建议剂量】：\r\n\r\n将胶囊打开，把鱼油挤入果汁中服用，或遵医嘱。\r\n\r\n2-6儿童每日1粒；\r\n\r\n6-12岁儿童每日1-2粒，或遵医嘱。</span></pre>\r\n','','','2018-09-18 11:06:22','2020-04-09 12:10:25','NZ','限时特价',36,NULL,'',''),(464,231,'9400501001116',NULL,'Comvita 新包装康维他 麦卢卡蜂蜜 5+ 500g（22.01）','Comvita Manuka Honey UMF 5+ 500g',NULL,'attachment/img/2019-04-13/20190413_115659_130.jpg',30,33.9,0,0,0,1,NULL,NULL,NULL,NULL,54,NULL,0,1,53.00,0.00,NULL,0.65,NULL,464,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/%E5%BA%B7%E7%BB%B4%E4%BB%96%205+%E8%9C%82%E8%9C%9C500g_desc1.jpg\" style=\"width: 790px; height: 1530px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/%E5%BA%B7%E7%BB%B4%E4%BB%96%205+%E8%9C%82%E8%9C%9C500g_desc2.jpg\" style=\"width: 790px; height: 1481px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/%E5%BA%B7%E7%BB%B4%E4%BB%96%205+%E8%9C%82%E8%9C%9C500g_desc3.jpg\" style=\"width: 790px; height: 1356px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/%E5%BA%B7%E7%BB%B4%E4%BB%96%205+%E8%9C%82%E8%9C%9C500g_desc4.jpg\" style=\"width: 790px; height: 1476px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/%E5%BA%B7%E7%BB%B4%E4%BB%96%205+%E8%9C%82%E8%9C%9C500g_desc5.jpg\" style=\"width: 790px; height: 1464px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/%E5%BA%B7%E7%BB%B4%E4%BB%96%205+%E8%9C%82%E8%9C%9C500g_desc6.jpg\" style=\"width: 790px; height: 1577px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/%E5%BA%B7%E7%BB%B4%E4%BB%96%205+%E8%9C%82%E8%9C%9C500g_desc7.jpg\" style=\"width: 790px; height: 1686px;\" /></p>\r\n','','','2018-09-18 11:06:22','2019-12-31 16:14:00','NZ','',0,NULL,'',''),(465,243,'9347802000021',NULL,'Revive 脚套','Revive 