\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/9.jpg\" style=\"width: 790px; height: 726px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/10.jpg\" style=\"width: 790px; height: 488px;\" /></p>\r\n','','','2018-09-18 11:06:24','2019-04-28 18:28:38','NZ','',0,NULL,'',''),(512,245,'4210201856191',NULL,'Oral-B 电动牙刷 敏感型','Oral-B Vitality Sensitive Clean Electric Toothbrush',NULL,'attachment/img/2019-03-15/oral-b_vitality_sensitive_clean_rechargeable_power_toothbrush_1.png',19.5,25.99,0,0,0,1,NULL,NULL,NULL,NULL,374,NULL,0,1,9867.00,0.00,NULL,0.35,NULL,459,'','<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"color:#3498db;\"><strong>敏感型（VITALITY Sensitive）</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:18px;\">针对怕冷，出血等牙齿！刷毛最柔软！</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px;\">牙刷刷毛最柔软，最温和，适合牙龈敏感.有牙周疾病.刷牙容易流血的人群。内含1个充电器.1个刷柄.2个刷头.说明书。优点：2分钟提醒功能，机身防水，自动感应充电，不会过度充电。连续充电16个小时可以充满，一次充电使用约5天。每分钟高达7600次2D刷动。</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#3498db;\"><span style=\"font-size:18px;\">1：一个充电器（座充，感应充电）</span></span></p>\r\n\r\n<p><span style=\"color:#3498db;\"><span style=\"font-size:18px;\">2：一个机身，也就是刷柄</span></span></p>\r\n\r\n<p><span style=\"color:#3498db;\"><span style=\"font-size:18px;\">3：此款牙刷自带2个刷头。</span></span></p>\r\n\r\n<p><span style=\"color:#3498db;\"><span style=\"font-size:18px;\">4：说明书一份（英文）&nbsp;</span></span></p>\r\n\r\n<p><span style=\"color:#3498db;\"><span style=\"font-size:18px;\">5、有2分钟自动提醒功能。</span></span></p>\r\n\r\n<p><span style=\"color:#3498db;\"><span style=\"font-size:18px;\">6、此型号牙刷防水和不会过充，可以放在卫生间使用，不用的时候可以随时插在充电座上保持满电。</span></span></p>\r\n\r\n<p><span style=\"color:#3498db;\"><span style=\"font-size:18px;\">7、连续充电16个小时可以充满，之后可以使用大概5天（每天刷牙2次，每次2分钟）。</span></span></p>\r\n\r\n<p><span style=\"font-size:18px;\">【注意事项】</span></p>\r\n\r\n<p><span style=\"font-size:18px;\">1.&nbsp;建议每三个月换一次刷头，第一是为了保证刷牙效果，第二是因为牙刷其实也挺容易脏的，即时更换可以避免细菌的侵袭，保持口腔健康！</span></p>\r\n\r\n<p><span style=\"font-size:18px;\">2.&nbsp;这个澳洲的产品，都是三角插的，所以家里没有三角插的，注意用一个转换插头啊！</span></p>\r\n\r\n<p><span style=\"font-size:18px;\">3.&nbsp;牙刷是100%德国原装进口，采购于澳洲超市。<span style=\"color:#e74c3c;\">刷头德国制造，刷柄和插座中国制造</span>，小伙伴们请知悉！</span></p>\r\n','','','2018-09-18 11:06:24','2019-09-26 16:59:48','NZ','',0,NULL,'',''),(513,NULL,'9369998011605',NULL,'koehl 龙珠洁面球（粉色）','Koehl Cleansing Ball-Lime Caviar(Pink)',NULL,'attachment/img/2018-10-10/龙珠洁面球 (5).jpg',23,24.5,0,0,0,0,NULL,0,NULL,NULL,2,NULL,0,1,4.00,0.00,NULL,0.23,NULL,0,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc2.jpg\" style=\"width: 750px; height: 934px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc3.jpg\" style=\"width: 750px; height: 680px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc4.jpg\" style=\"width: 750px; height: 965px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc5.jpg\" style=\"width: 750px; height: 871px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc6.jpg\" style=\"width: 750px; height: 823px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc7.jpg\" style=\"width: 750px; height: 859px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc8.jpg\" style=\"width: 750px; height: 931px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc10.jpg\" style=\"width: 750px; height: 634px;\" /><img