t: 862px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_195.jpg\" style=\"width: 800px; height: 536px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_196.jpg\" style=\"width: 800px; height: 1426px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_197.jpg\" style=\"width: 800px; height: 748px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_198.jpg\" style=\"width: 800px; height: 1121px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_199.jpg\" style=\"width: 800px; height: 1301px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_200.jpg\" style=\"width: 800px; height: 1001px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_201.jpg\" style=\"width: 800px; height: 1152px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_202.jpg\" style=\"width: 800px; height: 755px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_203.jpg\" style=\"width: 800px; height: 2922px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_204.jpg\" style=\"width: 800px; height: 1553px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_155956_205.jpg\" style=\"width: 800px; height: 1125px;\" /></p>\r\n','','','2018-11-02 17:38:03','2019-05-28 22:37:53','NZ','限时特价',0,NULL,'',''),(749,200,'9334518004740',NULL,'Chantelle 香娜露儿 羊胎素护肤4件套装','Chantelle gift pack (eye treatment 15g+facial treatment 30ml+lotion 100ml+day treatment 50g)','','attachment/img/2018-11-06/Chantelle 香娜露儿 羊胎素护肤4件套 (1).jpg',44.5,54.5,0,NULL,NULL,1,NULL,NULL,NULL,NULL,2,NULL,NULL,NULL,98.00,100.00,NULL,1.15,'',586,'','<h3>香娜露儿金色系列护肤礼盒（4件装）</h3>\r\n\r\n<p><strong>All Day Treatment:</strong><br data-filtered=\"filtered\" />\r\n香娜露儿全日面部美白护理霜是一款全日保湿，滋润，紧实肌肤的面部高级护理霜。蕴含芦荟，羊胎素及霍霍巴油等独特成分，使肌肤更亮丽年轻。&nbsp;<br data-filtered=\"filtered\" />\r\n<strong>Eye Treatment Film:</strong>&nbsp;<br data-filtered=\"filtered\" />\r\n香娜露儿眼部护理修护霜是一款淡化眼周暗沉，削弱细纹与眼袋，有效防止眼部肌肤松弛，暗沉的高级护理眼霜。蕴含天然植物油浓缩精粹和弹力保湿因子，质地清爽，紧致并滋润眼部细嫩肌肤。&nbsp;<br data-filtered=\"filtered\" />\r\n<strong>Facial Treatment Essence:</strong>&nbsp;<br data-filtered=\"filtered\" />\r\n香娜露儿紧致保湿修复精华是一款可促进细胞再生，强效修复肌肤，恢复肌肤年轻光泽的护肤品。富含澳洲天然羊胎盘素萃取液。&nbsp;<br data-filtered=\"filtered\" />\r\n<strong>Lotion:</strong>&nbsp;<br data-filtered=\"filtered\" />\r\n香娜露儿润泽舒缓滋养乳液是一款强效滋润舒缓，为全身肌肤提供营养的护肤产品。</p>\r\n\r\n<p><b>使用方法</b></p>\r\n\r\n<p><strong>All Day Treatment:</strong>&nbsp;<br data-filtered=\"filtered\" />\r\n早晚洁颜后均匀涂抹于面部&nbsp;<br data-filtered=\"filtered\" />\r\n<strong>Eye Treatment Film:</strong>&nbsp;<br data-filtered=\"filtered\" />\r\n早晚洁颜后涂抹眼周，并轻轻按摩几分钟&nbsp;<br data-filtered=\"filtered\" />\r\n<strong>Facial Treatment Essence:</strong>&nbsp;<br data-filtered=\"filtered\" />\r\n早晚洁颜后涂于面颈部，然后轻轻按揉至肌肤充分吸收&nbsp;<br data-filtered=\"filtered\" />\r\n<strong>Lotion:</strong>&nbsp;<br data-filtered=\"filtered\" />\r\n沐浴后或早上出门前涂抹于全身肌肤易开干燥处，并轻轻按揉至肌肤充分吸收</p>\r\n\r\n<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_153543_187.jpg\" style=\"width: 800px; height: 800px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_153543_189.jpg\" style=\"width: 960px; height: 1500px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_153543_190.jpg\" style=\"width: 960px; height: 1500px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_153543_191.jpg\" style=\"width: 960px; height: 1500px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_153543_192.jpg\" style=\"width: 960px; height: 1500px;\" /></p>\r\n','','','2018-11-02 17:44:26','2019-09-25 12:32:59','NZ','',NULL,NULL,'','<p>&nbsp;内含：眼霜15g+精华30ml+保湿修护乳液100ml+面霜50g</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(750,200,'9319629105722',NULL,'Dr Lewinn\'s 莱文医生八胜肽套盒 (内含：眼霜15g+日霜30g+晚霜30g)','Dr Lewinn\'s line smoothing comples s8(eye cream 15g+day cream 30g+night cream 30g)','','attachment/img/2019-03-15/莱文医生.png',82,96.7,0,NULL,NULL,1,NULL,NULL,NULL,NULL,65,NULL,NULL,NULL,35.00,100.00,NULL,0.35,'',562,'','<p><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-15/20190315_125429_008.jpg\" style=\"width: 750px; height: 1092px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-15/20190315_125429_009.jpg\" style=\"width: 750px; height: 1092px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-15/20190315_125429_010.jpg\" style=\"width: 750px; height: 838px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-15/20190315_125429_011.jpg\" style=\"width: 750px; height: 895px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-15/20190315_125429_012.jpg\" style=\"width: 750px; height: 1242px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-15/20190315_125429_013.jpg\" style=\"width: 750px; height: 714px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-15/20190315_125429_014.jpg\" style=\"width: 750px; height: 1116px;\" /></p>\r\n','','','2018-11-02 17:49:07','2019-11-11 17:49:24','NZ','',NULL,NULL,'',''),(751,200,'9334518004917',NULL,'Chantelle 香娜露儿 金色羊胎素 10ml 单支装','Chantelle bio-placenta 10ml','','attachment/img/2018-11-06/Chantelle棕色羊胎素精华_主图3.jpg',8,8.5,0,NULL,NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,100.00,100.00,NULL,0.10,'',14,'','<p>&nbsp;</p>\r\n\r\n<p>香娜露儿金色系列复合羊胎素原液是一款能强效修复肌肤，令肌肤嫩滑紧致、拥有天鹅绒般丝滑质感，光彩亮丽的高级护肤品。 富含澳洲天然浓缩羊胎素、有机葡萄籽精粹与维他命E。适用于各类肌肤。尤其适用于面部皮肤粗糙，暗黄，斑点严重的人士。亦特别推荐生活不规律、熬夜、吸烟，长期服用抗生素的人士使用。</p>\r\n\r\n<p><b>使用方法</b></p>\r\n\r\n<p>1. 取适量香娜露儿金色系列复合羊胎素原液于掌心内，用指腹蘸取原液轻轻敷于面部；</p>\r\n\r\n<p>2.&nbsp;用手指轻轻按摩面部，注意手势往面部上方提拉；</p>\r\n\r\n<p>3.&nbsp;轻拍面部，助于肌肤有效吸收原液精华；</p>\r\n\r\n<p>4.&nbsp;早晚在爽肤水后