 />\r\n是什么让 Oral-B 刷头如此独特？他们的灵感来自牙医每天使用的工具。这就是为什么 Oral-B 是全球第一牙医推荐的品牌也就不足为奇了。<br />\r\n<br />\r\n每3个月更换刷子头<br />\r\n牙医建议每3-4个月更换一次牙刷。Oral-B 更换牙刷头功能指示刷毛, 中途褪色, 以帮助提醒你什么时候更换牙刷头, 所以你比普通的手动牙刷保持一个优越的清洁。<br />\r\n<br />\r\n适用于</span></p>\r\n\r\n<p><span style=\"font-size:18px;\">&middot;卓越的清洁<br />\r\n&middot;儿童牙齿<br />\r\n<br />\r\n如何使用<br />\r\n<span style=\"color:#3498db;\"><strong>牙医建议每3个月更换一次牙刷, 或者在刷毛褪色和磨损时更换牙刷, 以获得更好的清洁效果。</strong></span><br />\r\n<br />\r\n重要信息<br />\r\n特征<br />\r\n<br />\r\n专为儿童设计的独特电动牙刷头<br />\r\n提供温和的刷牙体验<br />\r\n理想的大小和柔软性的儿童嘴<br />\r\n用Frozen使刷牙变得有趣<br />\r\n与 Oral-B 级电源儿童电动可充电式牙刷手柄兼容, Oral-B 声波牙刷除外</span></p>\r\n','','','2018-11-08 17:06:06','2019-09-26 16:49:03','NZ','',NULL,NULL,'',''),(778,232,'9400501003509',NULL,'Comvita 康维他 蜂胶喷雾  UMF10+ 20ml','Propolis Oral Spray UMF10+ 20ml','','attachment/img/2019-02-19/Comvita康维他 蜂胶喷雾 20毫升.jpg',11,12.99,0,NULL,NULL,1,NULL,NULL,NULL,NULL,2,NULL,NULL,NULL,12.00,100.00,NULL,0.00,'',501,'','<p><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-21/20190321_173446_000.jpg\" style=\"width: 990px; height: 584px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-21/20190321_173446_001.jpg\" style=\"width: 990px; height: 421px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-21/20190321_173446_002.jpg\" style=\"width: 990px; height: 446px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-21/20190321_173446_003.jpg\" style=\"width: 990px; height: 784px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-21/20190321_173446_004.jpg\" style=\"width: 990px; height: 458px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-21/20190321_173446_005.jpg\" style=\"width: 990px; height: 666px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-21/20190321_173446_006.jpg\" style=\"width: 990px; height: 557px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/arti