ment/article/2019-04-17/20190417_152305_178.jpg\" style=\"width: 790px; height: 3587px;\" /></p>\r\n','','','2018-11-09 17:56:02','2019-04-28 15:36:30','NZ','',NULL,NULL,'',''),(810,256,'9416630003716',NULL,'Ellis Fibre 羊驼被King号 400GSM 220cm*240cm','','','attachment/img/2019-02-18/Ellis Fibre 羊驼被King号 400GSM 220cmX240cm.jpg',230,295,0,NULL,NULL,1,NULL,NULL,NULL,NULL,7,NULL,NULL,NULL,999993.00,100.00,NULL,5.00,'',522,'','<p>&nbsp;</p>\r\n\r\n<p>Ellis Fibre的羊驼毛冬被质量如何？作为一个高端知名羊驼毛冬被品牌，Ellis Fibre拥有全球顶级的制作技术和时尚艺术交汇传承的优势，同时Ellis Fibre自身也具备多年技术研发实力，更通过与广大客户互动中吸纳了诸多新锐的元素，更坚定的向着广大客户最喜爱贴心的方向前进。正是因为如此，Ellis Fibre才能成为新西兰以及全球最知名的被子被芯品牌之一。Ellis Fibre从产品原材料到生产技术工艺，都是全球最优质、最优秀的，从而保证填充物为100%新西兰原产羊驼毛。羊驼一年只剪一次毛，一只成年羊驼一年仅有3公斤的毛，目前新西兰仅有大约12000只羊驼，所以新西兰羊驼毛是全世界珍贵的一流毛织品以及床上用品的原料，其皮毛被称之为&ldquo;软黄金&rdquo;。羊驼毛被与人体皮肤有极强的亲和能力，而且轻、柔、暖，恒温，被誉为&ldquo;床上佳品，礼品之冠&rdquo;。</p>\r\n\r\n<p><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-12/20190312_102836_012.jpeg\" style=\"width: 750px; height: 792px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-12/20190312_102836_013.jpeg\" style=\"width: 750px; height: 720px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-12/20190312_102836_014.jpeg\" style=\"width: 750px; height: 638px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-12/20190312_102836_015.jpeg\" style=\"width: 750px; height: 914px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-12/20190312_102836_016.jpeg\" style=\"width: 750px; height: 605px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-12/20190312_102836_017.jpeg\" style=\"width: 750px; height: 812px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-12/20190312_102836_018.jpeg\" style=\"width: 750px; height: 984px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-12/20190312_102836_019.jpeg\" style=\"width: 750px; height: 734px;\" /><img alt=\"\" src=