		<tr>\r\n			<th>英文名称</th>\r\n			<td>Bellamy&#39;s Organic Apple Cinnamon Porridge 125g</td>\r\n		</tr>\r\n		<tr>\r\n			<th>品牌</th>\r\n			<td>Bellamy 贝拉米</td>\r\n		</tr>\r\n		<tr>\r\n			<th>产地</th>\r\n			<td>澳大利亚</td>\r\n		</tr>\r\n		<tr>\r\n			<th>规格</th>\r\n			<td>袋装 125g</td>\r\n		</tr>\r\n		<tr>\r\n			<th>保质期</th>\r\n			<td>与澳洲本地药房同步&nbsp;&nbsp; &nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>适用年龄</th>\r\n			<td>6个月以上</td>\r\n		</tr>\r\n		<tr>\r\n			<th>特别说明</th>\r\n			<td>\r\n			<p>阴凉干燥，不超过30度。由于米粉不含防腐剂，天气炎热的情况下请放入冰箱冷藏。米粉本身充气的，不是真空的。袋口有自封条。</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>【产品特点】</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>贝拉米有机苹果肉桂燕麦粥是用获得认证的有机全粒燕麦，小米和苹果和肉桂制成，不添加任何其他物质。</p>\r\n\r\n<p>来自澳洲有机农场原料均是小批量烹制，不加任何加工助剂。</p>\r\n\r\n<p>贝拉米有机苹果肉桂燕麦粥不含有防腐剂和添加剂，有的只是是天然的营养和香味，是不错的给宝宝初次添加的辅食。</p>\r\n\r\n<p><strong>成 &nbsp; &nbsp; &nbsp; 分：</strong><strong>有机燕麦，有机小米，有机苹果，有机肉桂，铁矿物质。</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>【<strong>食用说明】</strong></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1.在给婴儿准备食物前洗净双手。</p>\r\n\r\n<p>2.取2-4茶匙（5克米粉冲泡40毫升水）米粉放入干净的碗内。</p>\r\n\r\n<p>3.加入4-8茶匙(每茶匙相当于15毫升)母乳、等量的配方奶或者温水，搅拌直至成均匀稠度的糊状。可以按照自己的需要再适当稀释。&nbsp;</p>\r\n\r\n<p>（<strong>注:</strong>&nbsp;与其他的勾兑方式相比，母乳勾兑的效果通常会比较稀。每个婴儿都是不尽相同的，请按照每个婴儿的食量的大小而提供婴儿所需食物。）</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>存储方法：</strong>置于阴凉干燥，不超过30度的地方。由于米粉不含防腐剂，天气炎热的情况下请放入冰箱冷藏。米粉本身充气的，不是真空的。袋口有自封条。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>【婴儿辅食常见问答】</strong></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>如何判断宝宝是否准备好吃辅食？</strong>&nbsp;</p>\r\n\r\n<p>当宝宝能够接受流质食物之外的营养时，他会给您非常明确的信号，包括：&nbsp;</p>\r\n\r\n<p>1.对头部的控制。要接受辅食，你宝宝的头部必须能够保持竖直、稳定的姿势。</p>\r\n\r\n<p>2.停止吐舌反射。为了把固体食物留在嘴里并吞咽下去，宝宝需要停止用舌头把食物顶出嘴外的先天反射。</p>\r\n\r\n<p>3.在有支撑的情况下坐直。即使宝宝还不能坐在婴儿高脚餐椅上，也必须能在有支撑的情况下坐直，这样才能顺利地咽下食物。</p>\r\n\r\n<p>4.咀嚼动作。宝宝的口腔和舌头是与消化系统同步发育的。要开始吃辅食，宝宝应该能够把食物顶到口腔后部并吞咽下去。随着宝宝逐渐学会有效地吞咽，你可能会注意到宝宝流出来的口水少了；宝宝也可能会在这时开始长牙。</p>\r\n\r\n<p>5.体重明显增长。多数宝宝体重增加到出生时的两倍左右），到4个月大的时候，宝宝就已经准备好可以吃辅食了。</p>\r\n\r\n<p>6.食欲增强。宝宝似乎很饿，即使每天吃8～10次母乳或配方奶，看起来仍然很饿。</p>\r\n\r\n<p>7.宝宝对您吃的东西可能会感到很好奇。您的宝宝可能会开始盯着你碗里的米饭看，或者在您把面条从盘子里夹到嘴里的时候伸手去够，这说明他也想尝尝了。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>怎样帮助宝宝养成良好的进餐习惯？</strong></p>\r\n\r\n<p>1.不要给宝宝喂得太多，注意观察宝宝吃饱的信号。</p>\r\n\r\n<p>2.不要强迫宝宝吃不喜欢的食物，您应该尊重孩子的喜好，别让宝宝的吃饭时间变成一场战争。</p>\r\n\r\n<p>3.尽量为孩子提供含蛋白质、碳水化合物、水果和蔬菜的平衡饮食，注意保持糖、盐和油的摄入适量。</p>\r\n\r\n<p>4.尽可能不给宝宝吃快餐。</p>\r\n\r\n<p>5.不要用食物来收买或奖励孩子，而是要给孩子大量的拥抱、亲吻和关注。</p>\r\n\r\n<p>6.尽可能让孩子坐在高脚餐椅上吃东西，而不要让孩子一边看电视或玩耍，一边吃东西。&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>食用辅食有什么好处？</strong></p>\r\n\r\n<p>好处一：辅食培养宝贝的味觉习惯</p>\r\n\r\n<p>好处二：辅食训练宝贝咀嚼能力辅食促进牙齿发育</p>\r\n\r\n<p>好处三：辅食促进语言发育</p>\r\n\r\n<p>好处四：辅食促进宝贝肠道发育</p>\r\n\r\n<p>好处五：辅食促进牙齿发育</p>\r\n','','','2018-12-13 14:07:26','2019-10-30 10:58:37','NZ','',NULL,NULL,'',''),(855,181,'9400581032819',NULL,'Nutralife 纽乐 高含量维骨力 关节灵 1500mg 180粒','','','attachment/img/2018-12-16/纽乐高含量关节灵1500mg.jpg',28.3,34.5,0,NULL,NULL,1,NULL,NULL,NULL,NULL,13,NULL,NULL,NULL,6.00,100.00,NULL,0.00,'',492,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-12/20190412_104105_000.jpg\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-12/20190412_104105_001.jpg\" style=\"width: 945px; height: 869px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-12/20190412_104105_002.jpg\" style=\"width: 945px; height: 1216px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-12/20190412_104105_003.jpg\" style=\"width: 945px; height: 673px;\" /></p>\r\n','','','2018-12-13 15:06:22','2019-06-18 22:19:13','NZ','',NULL,NULL,'',''),(856,231,'9400501100079',NULL,'Comvita 康维他 麦卢卡蜂蜜 18+ 250g','','','attachment/img/2018-12-16/O1CN011VodpQgmmW0lV08_!!85292700.jpg',83,92.99,0,NULL,NULL,1,NULL,NULL,NULL,NULL,5,NULL,NULL,NULL,95.00,100.00,NULL,0.0