o.nz/attachment/article/2019-03-21/%E6%B8%85%E8%82%BA%E8%AF%A6%E6%83%85_11.jpg\" style=\"width: 750px; height: 1185px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-21/%E6%B8%85%E8%82%BA%E8%AF%A6%E6%83%85_12.jpg\" style=\"width: 750px; height: 1114px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-21/%E6%B8%85%E8%82%BA%E8%AF%A6%E6%83%85_13.jpg\" style=\"width: 750px; height: 1275px;\" /></p>\r\n','','','2019-03-04 16:08:57','2019-09-25 16:47:46','NZ','',1,NULL,'',''),(903,176,'9400514010587',NULL,'Pro-life 羊奶加钙咀嚼片 羊奶片 香草口味 500粒','','','attachment/img/2019-03-06/ProLife 羊奶加钙咀嚼片.jpg',19.5,23.99,0,NULL,NULL,1,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,10.00,2.00,NULL,0.00,'',125,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-03-09/ProLife%20%E7%BE%8A%E5%A5%B6%E5%8A%A0%E9%92%99%E5%92%80%E5%9A%BC%E7%89%87%E8%AF%A6%E6%83%85%E5%9B%BE.jpg\" style=\"width: 750px; height: 1029px;\" /></p>\r\n','','','2019-03-05 17:03:20','2019-05-02 13:44:50','NZ','',NULL,NULL,'',''),(904,181,'9421031781286',NULL,'MitoQ 姜黄素 60粒（新版）','','','attachment/img/2019-03-06/Mitoq姜黄素.jpg',68,76.6,0,NULL,NULL,1,NULL,NULL,NULL,1,0,NULL,NULL,NULL,100.00,2.00,NULL,0.00,'',556,'','<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-03-09/MitoQ%20%E5%A7%9C%E9%BB%84%E7%B4%A001.jpg\" style=\"width: 800px; height: 5236px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-03-09/MitoQ%20%E5%A7%9C%E9%BB%84%E7%B4%A002.jpg\" style=\"width: 800px; height: 6326px;\" /></p>\r\n','','','2019-03-05 17:08:37','2019-07-03 10:14:03','NZ','',NULL,NULL,'',''),(905,244,'9421903418395',NULL,'Oasis Sun SPF 30PA++ 纯天然儿童防水防晒棒 含锌 30g','Oasis Sun SPF 30 Kids Zinc Sunscreen Stick 30g','','attachment/img/2019-03-11/Oasis 防晒棒.png',11,12.99,0,NULL,NULL,1,NULL,NULL,NULL,NULL,3,NULL,NULL,NULL,2.00,2.00,NULL,0.00,'',475,'','<p><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-11/1550964230589.jpg\" style=\"width: 709px; height: 400px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Oasis Sun家族再添新成员Kids Zinc Stick-纯天然儿童防晒棒</p>\r\n\r\n<p>1. 100%纯天然防晒含有31%锌&nbsp; &nbsp;</p>\r\n\r\n<p>2. SPF 30 PA++ UVA&amp;UVB</p>\r\n\r\n<p>3.&nbsp;40mins 防水效果</p>\r\n\r\n<p>4. 适合敏感肌和全身使用</p>\r\n\r\n<p>5. 低敏配方</p>\r\n\r\n<p>6. 便携30g小包装</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-11/%E5%BE%AE%E4%BF%A1%E5%9B%BE%E7%89%87_20190311173955.png\" style=\"width: 496px; height: 408px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>What is UVA/UVB?</strong></em></p>\r\n\r\n<p>UVA是可怕的阳光杀手，它借着波长比较长，穿透能力强的本领，可以穿透皮肤表层，深入真皮以下组织，可以破坏胶原蛋白，弹性纤维组织等皮肤内部的微细结构，产生皱纹和幼纹，令皮肤松弛衰老。这在医学上称之为光致老化。</p>\r\n\r\n<p>在阳光中紫外线的能量分布中，UVA是UVB的15倍，是令皮肤晒黑的主要原因。它能使皮肤里结合水的透明质酸含量减少，令皮肤干燥，加速黑色素形成，使肤色变黑，同时也是引起皮肤癌的重要原因。</p>\r\n\r\n<p>人们发现一般强度的阳光UVA照射在皮肤上，约经过2－4小时，皮肤就会出现比较稳定的黑化，学术上称&ldquo;持续型即时黑化&rdquo;。</p>\r\n\r\n<p>UVB的伤害和防护已经得到彻底的研究，它可以使皮肤在短时间内晒伤、晒红（对一般人来说是25分钟左右），现市场上绝大多数防晒品是UVB型的，SPF就是UVB防护能力的标志。</p>\r\n\r\n<p><em><strong>What is SPF?</strong></em></p>\r\n\r\n<p>SPF (Sun Protection Factor)&nbsp;所谓SPF值是指产品防护UVB的能力，也就是防止皮肤晒红晒伤的能力。</p>\r\n\r\n<p><em><strong>What is PA++?</strong></em></p>\r\n\r\n<p>&ldquo;PA&rdquo;表示产品防护UVA的能力，也就是防止晒黑的能力。</p>\r\n','','','2019-03-11 16:22:11','2019-04-28 11:21:27','NZ','',NULL,NULL,'','<p>满1kg包新西兰直邮<br />\r\n快递默认为富腾达</p>\r\n\r\n<p>Over 1kg shipping free</p>\r\n\r\n<p>Express defaults to FTD</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(906,200,'9334518005501',NULL,'Chantelle 香娜露儿 积雪草循环水爽肤水120ml高保湿修复','','','attachment/img/2019-03-12/b57fe4d43a8d06c0.jpg',108,36.49,0,NULL,NULL,1,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,9.00,2.00,NULL,0.00,'',492,'','<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>香娜露儿积雪草循环水富含翼子辣木籽精华、天然积雪草提取物、木瓜蛋白酶及丰富的维他命E。香娜露儿积雪草循环水为肌肤提供隐形口罩，抵御雾霾污染，激活胶原蛋白再生，软化角质层、美白祛斑，缩水保湿。适用于各类肌肤。</p>\r\n\r\n<p><b>使用方法</b></p>\r\n\r\n<p>1、日常使用<br data-filtered=\"filtered\" />\r\n洁面后，用带香娜露儿积雪草循环水的棉片轻拍面部，大量补水且快速吸收，后续使用香娜露儿全能保湿乳液深锁水分，持续滋润。<br data-filtered=\"filtered\" />\r\n<br data-filtered=\"filtered\" />\r\n2、水膜<br data-filtered=\"filtered\" />\r\n将倒香娜露儿积雪草循环水在面膜纸上，湿敷（3-8分钟），用于妆前打底或者周护理。</p>\r\n\r\n<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_186.jpg\" style=\"width: 790px; height: 1423px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_177.jpg\" style=\"width: 790px; height: 1163px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_178.jpg\" style=\"width: 790px; height: 890px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_179.jpg\" style=\"width: 790px; height: 629px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_180.jpg\" style=\"width: 790px; height: 1340px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_181.jpg\" style=\"width: 790px; height: 1005px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_182.jpg\" style=\"width: 790px; height: 572px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_183.jpg\" style=\"width: 790px; height: 716px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_184.jpg\" style=\"width: 790px; height: 1078px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2019-04-13/20190413_152728_185.jpg\" style=\"width: 790px; height: 1363px;\" /></p>\r\n','','','2019-03-11 16:41:11','2019-04-28 11:21:17','NZ','',NULL,NULL,'',''),(907,200,'9312146000174',NULL,'Thursday Plantation 星期四农庄 祛痘凝胶 25g（新西兰版）','Thursday plantation tea tree Blemish Gel 25g','','attachment/img/2019-05-01/tea tree blemish gel.jpg',8,9.5,0,NULL,NULL,1,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,96.00,100.00,NULL,0.00,'',476,'','<p><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-05-01/%E6%98%9F%E6%9C%9F%E5%9B%9B%E5%86%9C%E5%BA%84%E7%89%88%E6%9C%AC.jpg\" style=\"width: 800px; heig