n<p>○　圣玛丽蓟：350mg</p>\r\n\r\n<p>○　乳香：400mg</p>\r\n\r\n<p>○　硫酸葡萄糖胺：500mg</p>\r\n\r\n<p>○　维生素B3：200mg</p>\r\n\r\n<p>○　维生素C：100mg</p>\r\n\r\n<p>○　卵磷脂：100mg</p>\r\n\r\n<p>○　镁：6.65mg</p>\r\n\r\n<p>○　锰：6mg</p>\r\n\r\n<p>○　维生素D3：100IU</p>\r\n\r\n<p>适用人群&nbsp;SUITABLE FOR</p>\r\n\r\n<p>○　适合于成年人群使用。</p>\r\n\r\n<p>使用方法&nbsp;HOW TO USE</p>\r\n\r\n<p>○　成人每日2片，每次2片，随餐服用。或遵医嘱。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>注意事项&nbsp;ATTENTION</p>\r\n\r\n<p>○　使用前应仔细阅读标签，请勿过量服用；</p>\r\n\r\n<p>○　请勿将其放置在儿童可触及的地方；</p>\r\n\r\n<p>○　请存放于避光、干燥、不高于25摄氏度处；</p>\r\n\r\n<p>○　孕妇，哺乳期妇女和儿童，使用前请咨询医生；</p>\r\n\r\n<p>○　如有过敏现象，请立即停用并寻医就诊。</p>\r\n','','','2019-03-18 16:12:53','2019-04-28 11:18:12','NZ','',NULL,NULL,'',''),(913,200,'9352983000777',NULL,'LIONIA 溯颜焕活深海鱼子精华面膜 补水抗皱提亮 25ml*5片','','','attachment/img/2019-03-22/微信图片_20190322101345.png',24.5,31.99,0,NULL,NULL,1,NULL,NULL,0,NULL,0,NULL,NULL,NULL,100.00,100.00,NULL,0.27,'',513,'','<p><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-22/IMG_5340.JPG\" style=\"width: 1600px; height: 1600px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-22/IMG_5323.JPG\" style=\"width: 1600px; height: 1600px;\" /></p>\r\n','','','2019-03-21 18:04:03','2019-04-28 11:17:56','NZ','',NULL,NULL,'',''),(914,200,'9352983000500',NULL,'LIONIA 深海鱼子酱精华焕活复颜滋润眼霜 紧致抗皱补水 15g','','','attachment/img/2019-03-22/003.jpg',36.5,41.99,0,NULL,NULL,1,NULL,NULL,0,NULL,0,NULL,NULL,NULL,100.00,100.00,NULL,0.20,'',471,'','','','','2019-03-22 10:03:10','2019-04-28 11:17:46','NZ','',NULL,NULL,'',''),(915,200,'9352983000333',NULL,'LIONIA 深海鱼子精华紧致肌底液精华 抗皱滋养提拉紧致补水 15ml','','','attachment/img/2019-03-22/微信图片_20190322100728.png',24.5,31.99,0,NULL,NULL,1,NULL,NULL,0,NULL,0,NULL,NULL,NULL,100.00,100.00,NULL,0.26,'',471,'','<p><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-22/20190322_100711_000.jpg\" style=\"width: 750px; height: 911px;\" /><img alt=\"\" src=\"http://www.yomi.co.nz/attachment/article/2019-03-22/20190322_100711_001.jpg\" style=\"wid