19-05-16 22:49:26','NZ','澳洲仓',9,NULL,'',''),(931,166,'',NULL,'Wyeth惠氏S26金装婴儿奶粉1段（初生婴儿）900g*6罐','S26 Gold Alula Newborn 900g','','attachment/img/2019-04-01/惠氏1段.jpg',0,197,0,NULL,NULL,1,NULL,NULL,1,NULL,0,NULL,NULL,NULL,100.00,100.00,NULL,0.00,'',515,'','<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">产品介绍：</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26 Gold 澳洲惠氏金装一段奶粉(0-6个月的婴儿) 900g 升级配方，全面营养&mdash;&mdash;惠氏BIO营养优惠系统TM良好的营养有助眼睛、中枢神经及体格发育。叶黄素、DHA、维生素A和牛磺酸等：支持&ldquo;学能之窗&rdquo;&mdash;&mdash;眼睛的发育。乳清蛋白、DHA/AA和维生素B12、铁和锌等：有助于中枢神经系统发育&mdash;&mdash;把握学能发展的核心。乳清蛋白、核苷酸、天然胡萝卜素和硒等：强壮健康体格&mdash;&mdash;构筑学能发展的基础。好眼力，好脑袋，好身体，三者环环相扣，宝宝学习能力更强，当然学的又快又乐。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　规格：900g</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　品牌：S-26 澳洲惠氏</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　发货国家;澳大利亚</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">产品特点：</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　不含蔗糖，口感清淡更有利于宝宝的健康成长；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　热量和脂肪含量比国产的要低，不会导致宝宝过胖，也不易上火；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　S-26金装是专门设计的，以确保婴儿获得均衡的，高品质的组合成分，以帮助支持健康成长和发展。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">功能概述：</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　Omega-3：帮助大脑和视力的发育，增强免疫系统。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　核苷酸：提高宝宝的抵抗力。改善过敏体质；增加双歧杆菌；提高脂肪代谢。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　Iron（铁）：是必需的营养素，帮助宝宝生长发育。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　维生素D：建筑宝宝坚强的骨骼发育。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">主要成份：</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　麦芽糊精、无脂奶、植物油（棕榈）、浓缩乳清蛋白、蔗糖、卵磷脂、甘油一酸酯、乙基香草醛、长链多不饱和脂肪酸（LCPs: AA、DHA）、矿物质：氢氧化钾、氯化钾、碳酸氢钠、硫酸铁、碳酸氢钾、锌、硫酸锰铜、碘化钾、维生素：C、B3、B1、B6、A、H、D3、K1、生育酚醋酸酯、浓缩混合生育酚、泛酸钙、天然胡萝卜素、核黃素、叶酸。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">适用人群：</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　适用于0-6个月的宝宝。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">使用方法：</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在准备配方前请洗手；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　哺乳用具要在沸水中消毒；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　滚水并使其冷却到哺育温度（大约摄氏37度）；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　量好冷却的适温开水并装入消毒过的奶瓶中；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　用罐中的勺子装好一勺奶粉，不要积压，用餐刀刮平多余部分,按照说明加入水中；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\">