\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　全面提升宝宝神经系统、消化系统和免疫系统，让宝宝健康成长；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　帮助大脑和视力的发育，增强免疫系统；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　帮助宝宝骨骼和牙齿的发育，提供宝宝每天的成长发育所需营养；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　帮助红细胞把氧气传送到全身各个器官，帮助各个器官的发育。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">主要成份</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　乳糖、叶黄素、乳清蛋白浓缩物、大豆卵磷脂、甘油单酯、脂肪酸、二十二碳六烯酸、L-酪氨酸、L-蛋氨酸、牛磺酸、酸性调节剂（柠檬酸）、核苷酸、L-色氨酸、L-组氨酸、L-肉碱、混合生育酚浓缩物、抗坏血酸棕榈酸酯、碳酸钙、柠檬酸钾氯化钙、磷酸钠、柠檬酸钠、氢氧化钾、硫酸铜、维生素C、胆碱、肌醇、维生素E、烟酸、泛酸、维生素B1、维他命A、维生素B2、维生素B6、&beta;-胡萝卜素、叶酸、维生素K、生物素、维生素D、维生素B12。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">适用人群</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　适用于6-12个月的宝宝。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">使用方法</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在准备配方前请洗手，哺乳用具要在沸水中消毒。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　滚水并使其冷却到哺育温度（大约摄氏37度）。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　量好冷却的适温开水并装入消毒过的奶瓶中</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　用罐中的勺子装好一勺奶粉，不要积压，用餐刀刮平多余部分，按照说明加入水中。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在50毫升的水中加入一勺奶粉。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　盖好奶瓶，摇匀，在喂前请滴一滴在手腕上以测试适当的温度。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">注意事项</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　使用前应仔细阅读标签，请勿过量服用；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　请勿将其放置在儿童可触及的地方；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　请存放于避光、干燥、不高于25摄氏度处；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在罐底的保质期前使用。打开后请在4周之内用完；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　请按照说明的方法存储和准备喂食，婴儿将不需要额外的维生素和矿物质补充。</span></span></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">中文名称</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26 Gold 澳洲惠氏金装奶粉（6-12个月的婴儿）900g</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">英文名称</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26 Gold Alula Progress 900G</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">品牌</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">发货国家</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">澳大利亚</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','','','2019-04-01 13:28:20','2019-05-09 00:51:27','NZ','澳洲仓',5,NULL,'',''),(933,166,'',NULL,'Wyeth惠氏S26金装婴儿奶粉3段（1岁以上）900g*6罐','S26 Gold Alula Toddler 900g','','attachment/img/2019-04-01/惠氏3段.jpg',0,148,0,NULL,NULL,1,NULL,NULL,1,NULL,0,NULL,NULL,NULL,100.00,100.00,NULL,0.00,'',580,'','<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>产品介绍&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26 Gold 澳洲惠氏金装3段奶粉 （1岁以上的宝宝）900克</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">澳洲惠氏 S-26 金装奶粉的优势：先进的蛋白混合技术：增加Alpha 乳白蛋白含量的同时相对降低了Beta乳球蛋白的剂量， 给宝宝提供更好的蛋白平衡。Omega-3的均衡添加， 帮助宝宝大脑和眼睛得到最佳发育。核苷(Nucleotide) ：帮助建立和完善宝宝的免疫系统。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">澳洲惠氏 S-26 金装3段奶粉是专为一岁至三岁幼儿的营养需要而调配的幼儿配方奶粉。它提供了幼儿成长必须营养素。营养丰富，富含a乳清蛋白，均衡比例的DHA和AA并添加叶黄素。营养均衡，含有24种幼儿所必需的维生素和矿物质，及天然胡萝卜素。作为健康膳食的一部分均衡营养的良好来源。每日健康膳食外加三份 S-26，则幼儿的蛋白质、主要维生素和矿物质的摄入量，即可达到每日膳食营养素参考摄入量的百分之百。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　规格：900g</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　品牌：惠氏Wyeth&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　发货国家：澳大利亚</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>产品特点&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　不含蔗糖，口感清淡更有利于宝宝的健康成长</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　热量和脂肪含量比一般的要低，不会导致宝宝过胖，也不易上火</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　S-26金装是专门设计的，以确保婴儿获得均衡的，高品质的组合成分，以帮助支持健康成长和发展。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>功能概述&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　Omega-3：帮助大脑和视力的发育，增强免疫系统。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　核苷酸：提高宝宝的抵抗力。改善过敏体质；增加双歧杆菌；提高脂肪代谢。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　Iron（铁）：是必需的营养素，帮助宝宝生长发育。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　维生素D：建筑宝宝坚强的骨骼发育。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>主要成份&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　麦芽糊精、无脂奶、植物油（棕榈）、浓缩乳清蛋白、蔗糖、卵磷脂</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">　甘油一酸酯、乙基香草醛、长链多不饱和脂肪酸（LCPs: AA、DHA）</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">　矿物质：氢氧化钾、氯化钾、碳酸氢钠、硫酸铁、碳酸氢钾、锌、硫酸锰铜、碘化钾</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">　维生素：C、B3、B1、B6、A、H、D3、K1、生育酚醋酸酯、浓缩混合生育酚、泛酸钙、天然胡萝卜素、核黃素、叶酸。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>适用人群&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　适用于1岁以上的宝宝。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>使用方法</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在准备配方前请洗手，哺乳用具要在沸水中消毒；滚水并使其冷却到哺育温度（大约摄氏37度）；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　量好冷却的适温开水并装入消毒过的奶瓶中；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　用罐中的勺子装好一勺奶粉，不要积压，用餐刀刮平多余部分,按照说明加入水中；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在50毫升的水中加入一勺奶粉；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　盖好奶瓶，摇匀，在喂前请滴一滴在手腕上以测试适当的温度。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>注意事项&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　请放在儿童不能取及的地方，以及阴凉干燥处存放。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在罐底的保质期前使用。打开后请在4周之内用完</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　所有的婴儿配方最好在准备好后立刻使用。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　请按照说明的方法存储和准备喂食，婴儿将不需要额外的维生素和矿物质补充。</span></span></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">中文名称</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26 Gold 澳洲惠氏金装3段奶粉 900克（1岁以上的宝宝）</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">英文名称</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26 Gold Alula Toddler 900g</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">品牌</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Wyeth</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">发货国家</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">澳大利亚</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','','','2019-04-01 13:29:22','2019-05-07 23:17:11','NZ','澳洲仓',4,NULL,'',''),(934,166,'',NULL,'Wyeth惠氏S26金装婴儿奶粉4段（2岁以上）900g*6罐，','S26 Gold Alula Junior 900g','','attachment/img/2019-04-01/惠氏4段.jpg',0,148,0,NULL,NULL,1,NULL,NULL,1,NULL,1,NULL,NULL,NULL,99.00,100.00,NULL,0.00,'',486,'','<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>产品介绍&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26 Gold 澳洲惠氏金装4段奶粉 900克（2岁以上的宝宝）</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">澳洲惠氏 S-26 金装奶粉的优势：先进的蛋白混合技术：增加Alpha 乳白蛋白含量的同时相对降低了Beta乳球蛋白的剂量， 给宝宝提供更好的蛋白平衡。Omega-3的均衡添加， 帮助宝宝大脑和眼睛得到最佳发育。核苷(Nucleotide) ：帮助建立和完善宝宝的免疫系统。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">澳洲惠氏 S-26金装4段，适合2岁以上宝宝，含有16种维生素和矿物质，提供宝宝成长所需营养，并且添加了益生元纤维成分，减少宝宝便秘的发生，同时配方中的多种微元素也帮助宝宝对钙的吸收，促进骨骼和牙齿的发育。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　规格：900g</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　品牌：惠氏Wyeth&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　发货国家：澳大利亚</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>产品特点</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　不含蔗糖，口感清淡更有利于宝宝的健康成长</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　热量和脂肪含量比一般的要低，不会导致宝宝过胖，也不易上火</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　S-26金装是专门设计的，以确保婴儿获得均衡的，高品质的组合成分，以帮助支持健康成长和发展。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>功能概述&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　Omega-3：帮助大脑和视力的发育，增强免疫系统。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　核苷酸：提高宝宝的抵抗力。改善过敏体质；增加双歧杆菌；提高脂肪代谢。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　Iron（铁）：是必需的营养素，帮助宝宝生长发育。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　维生素D：建筑宝宝坚强的骨骼发育。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>主要成份&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　麦芽糊精、无脂奶、植物油（棕榈）、浓缩乳清蛋白、蔗糖、卵磷脂</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">　甘油一酸酯、乙基香草醛、长链多不饱和脂肪酸（LCPs: AA、DHA）</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">　矿物质：氢氧化钾、氯化钾、碳酸氢钠、硫酸铁、碳酸氢钾、锌、硫酸锰铜、碘化钾</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">　维生素：C、B3、B1、B6、A、H、D3、K1、生育酚醋酸酯、浓缩混合生育酚、泛酸钙、天然胡萝卜素、核黃素、叶酸。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>适用人群&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　适用于2岁以上的宝宝。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>使用方法&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在准备配方前请洗手，哺乳用具要在沸水中消毒；滚水并使其冷却到哺育温度（大约摄氏37度）；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　量好冷却的适温开水并装入消毒过的奶瓶中；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　用罐中的勺子装好一勺奶粉，不要积压，用餐刀刮平多余部分,按照说明加入水中；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在50毫升的水中加入一勺奶粉；</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　盖好奶瓶，摇匀，在喂前请滴一滴在手腕上以测试适当的温度。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>注意事项&nbsp;</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　请放在儿童不能取及的地方，以及阴凉干燥处存放。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　在罐底的保质期前使用。打开后请在4周之内用完</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　所有的婴儿配方最好在准备好后立刻使用。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">○　请按照说明的方法存储和准备喂食，婴儿将不需要额外的维生素和矿物质补充。</span></span></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">中文名称</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26 Gold 澳洲惠氏金装4段奶粉 900克（2岁以上的宝宝）</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">英文名称</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">S-26 Gold Alula Junior 900G</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">品牌</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Wyeth</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">发货国家</span></span></td>\r\n			<td><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">澳大利亚</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','','','2019-04-01 13:30:28','2019-05-07 23:17:19','NZ','澳洲仓',3,NULL,'','<p><span style=\"font-size:16px;\"><strong>澳洲发货</strong></span></p>\r\n'),(935,200,'9369998405893',NULL,'LELLURE 玲珑 V脸线雕精华 40ml 提拉紧致面部抗皱','','','attachment/img/2019-04-01/16e6cc9b6192cf8385cc87aa60238d85.jpg',32,34.99,0,NULL,NULL,1,NULL,NULL,NULL,1,163,NULL,NULL,NULL,-63.00,100.00,NULL,0.00,'',491,'','<p><img alt=\"\" src=\"http://www.yomi.co.nz/at